import React from "react";
import "./css/Profile.css"
import profile from "./img/korbalogo";

function Profile(params) {
    return(
        <div className= "profile">
            <img src= {profile} alt= "user" className= "image"/>
            <p id="name">LOGIN</p>
        </div>
    )

}

export default Profile;
